import React, { Component } from "react"
import TodoItem from "./TodoItem.js"

class TodoList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            todoItems: ["Do homework", "Do luandry"]
        }
    }

    render() {
        return (
            <ul>
                {todoItems.map(item => <TodoItem todoContent={item} />)}
            </ul>
        )
    }
}

export default TodoList
